import React, {useState, useEffect} from 'react';
import axios from 'axios';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import {useHistory, useLocation} from "react-router";

export default function Psychometry(){

    const history = useHistory();
    const location = useLocation();

    const apiUrl = '/test/question'
    const [name, setName] = useState(location.state.pname);
    const [age, setAge] = useState(location.state.page);
    const [gender, setGender] = useState(location.state.pgender);
    const [region, setRegion] = useState(location.state.pregion);
    const [question, setQuestion] = useState([]);

    useEffect(() =>{
        async function fetch() {
            const response = await axios.get(apiUrl);
            const question = response.data.result;
            setQuestion(question);
        };
        fetch();
    }, []);


    const pushdataToResult = () =>{
        history.push({
            pathname: "/Result",
            state: {
                pname : name,
                page : age,
                pgender : gender,
                pregion : region
            }
        })
    };

    const pushdataToPersonalData = () =>{
        history.push({
            pathname: "/PersonalData",
            state: {
                pname : name,
                page : age,
                pgender : gender,
                pregion : region
            }
        })
    };
    return(

        <div>
            <h1>
                심리검사 항목 테스트 페이지<br/><br/>

                {/* 아래는 히스토리 확인을 위한 임시코드 */}
                인적사항<br/>
                이름 : {name}<br/>
                연령대 : {age}<br/>
                성별 : {gender}<br/>
                지역 : {region}


            </h1>


            {question.map(
                (items) => 
                    <div>
                        <div>{items.question} : {items.question_item}</div>
                    </div>  
            )}
            <Button varient="primary" onClick={pushdataToPersonalData}>이전으로</Button>
            <Button varient="primary" onClick={pushdataToResult}>결과보기</Button>
        </div>
    );
}
